import React, {createContext, useCallback, useState} from 'react';

const AddQue = () => {

	return (
		<div>
			<select name="type" id="">
				<option value="single">单选</option>
				<option value="checkbox">多选</option>
				<option value="text">填空</option>
				<option value="rating">进度条</option>
			</select>
		</div>
	);
};

export default AddQue;
